import React from "react";
import { Menu } from "antd"
import { AppstoreOutlined, CarOutlined, ShopOutlined, ShoppingCartOutlined, TagOutlined, UserOutlined } from "@ant-design/icons";
import { useNavigate } from "react-router-dom";
export default function SideMenu() {
    const navigate = useNavigate();
    return (
        <div className="SideMenu">

            <Menu
                onClick={(item) => {
                    //item.key
                    navigate(item.key);
                }}
                items={[
                    {
                        label: "Dashboard",
                        icon: <AppstoreOutlined />,
                        key: '/pagequantri',
                    },
                    {
                        label: "Đơn hàng",
                        key: '/pagequantri/donhang',
                        icon: <ShoppingCartOutlined />
                    },
                    {
                        label: "Dịch vụ",
                        key: '/pagequantri/dichvu',
                        icon: <ShopOutlined />
                    },
                    {
                        label: "Khách hàng",
                        key: '/pagequantri/khachhang',
                        icon: <UserOutlined />
                    },
                    {
                        label: "Khuyến mãi",
                        key: '/pagequantri/khuyenmai',
                        icon: <TagOutlined />
                    },
                    {
                        label: "Xe",
                        key: '/pagequantri/xe',
                        icon: <CarOutlined />,
                    },
                ]}
            >

            </Menu>
        </div>
    )
}
